Mae cae petryal wedi'i gau mewn trac athletau, fel y dangosir isod. Mae'r trac yn cynnwys dau ymyl o'r cae, a dwy hanner cylch. Hyd y trac yw 400 metr. Beth yw'r arwynebedd mwyaf posibl o'r cae, mewn metrau sgwâr?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

response:
To determine the area of the largest possible square that Mae can cae within the trac, we need to analyze the given dimensions and constraints. The trac is a rectangle with a length of 400 meters and a width of 400 meters (since the trac is a square).

The trac has two straight sides and two semicircular ends. The total length of the trac is the sum of the lengths of the two straight sides and the circumferences of the two semicircles. Since each semicircle has a radius of 200 meters, the circumference of each semicircle is:
\[ \frac{1}{2} \times 2\pi \times 200 = 200\pi \text{ meters} \]

